#include <iostream>
#include <string>
#include <algorithm>
using namespace std;

const int maxn = 1e6 + 10;
const int maxch = 128;
int dp[maxn], pre[maxch];
bool visit[maxch];

class Solution {
public:
    int lengthOfLongestSubstring(string s) {
		if (s.length() == 0) return 0;

		dp[0] = 1; pre[s[0]] = 0; visit[s[0]] = true;
		int last = -1, ans = 1;
		for (int i = 1; i < s.length(); ++i) {
			if (!visit[s[i]]) { visit[s[i]] = true; dp[i] = dp[i-1]+1; }
			else {
				if (last < pre[s[i]]) { dp[i] = i-pre[s[i]]; last = pre[s[i]]; }
				else dp[i] = i-last;
			}
			pre[s[i]] = i;
			ans = max(ans, dp[i]);
		}
		return ans;
    }
};

